  \"2015-01-22T15:57:29.967177\",\n\t\"name\": \"coc-gis-tools-shapefile\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These datasets contain the geographic boundaries
  and funding status information for HUDu2019s Continuum of Care (CoC) areas by Year.nHUD
  is providing these datasets for use by CoC grantees, homeless services planners,
  and research institutions. Because HUD provides competitive funding for homeless
  services through a CoC structure that is developed at the local level, outside research
  based on this structure cannot be accomplished without the provision of the geographic
  boundaries and related data provided herein. Therefore, this dataset was developed
  to make the CoC process and funding as transparent as possible to the public.\",\n\t\"license_title\":
